+(void) addRange:(NSRange)range forKey:(NSString*)key
{
    NSValue *val = [NSValue valueWithRange:range];
    [cameraMap setValue:val forKey:key];
}

+(NSRange) getCameraParameter:(NSString*)parameterName
{
    NSValue* val = [cameraMap objectForKey:parameterName];
    NSRange range = [val rangeValue];
    return range;
}

